import React, {useState} from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import Home from './Home'
import Calculator from './Calculator/Calculator';
import ToDoTracker from './ToDoTracker/ToDoTracker';
import Navbar from './Navbar';

const App = () => {
  const links=[
              {name:"Home" , link:"/", element:<Home/>},
              {name:"Calculator" , link:"calculator", element:<Calculator/>},
              {name:"ToDoTracker" , link:"todotracker", element:<ToDoTracker/>}
            ];

  return(
    <div>
      <Navbar />

      <Routes>
        {links.map(link => {
          <Route path={link.link} element={link.element} />

        })}
      </Routes>
    </div>
  );

}

export default App;
